    false,nt"url": null,nt"notes": "The Snake Creek Embankment on U.S. Highway
    83 between Lake Audubon and Lake Sakakawea was home to a research project on bird
    strikes with power lines this year. This project area is located on Audubon National
    Wildlife Refuge. Engineering Data Management (EDM), an environmental consulting
    firm based out of Colorado, has been working in cooperation with Western Area Power
    Administration, Avian Powerline Interaction Committee, EPRI (a research institute
    concerned with electric power issues), various electric power companies, and the
    U.S. Fish and Wildlife Service (Service) on the study. Objectives of the research
    include determining the number of birds colliding with power lines paralleling the
    highway, developing technological tools for monitoring bird activity and collisions,
    and finding methods of marking power lines to reduce bird deaths. This brief report
    covers the 2001 field season and provides graphs of results.",nt"license_title":
